var intrebari = [
            {
                text: "Cine este personajul principal?",
                variante: {
                    A: "Eren Jaeger",
                    B: "Levi Ackerman"
                },
                raspunsCorect: "A"
            },
            {
                text: "Ce titlu poartă titanul care a distrus zidul Maria?",
                variante: {
                    A: "Titanul colosal",
                    B: "Titanul blindat"
                },
                raspunsCorect: "A"
            },
            {
                text: "Cine este fratele lui Eren?",
                variante: {
                    A: "Armin",
                    B: "Zeke"
                },
                raspunsCorect: "B"
            }
        ];

        var indexIntrebare = 0;
        var puncte = 0;

        function afiseazaIntrebare() {
            var intrebareCurenta = intrebari[indexIntrebare];
            document.getElementById("intrebare").innerHTML = intrebareCurenta.text;
			document.getElementById("variantaA").innerHTML = intrebareCurenta.variante.A;
            document.getElementById("variantaB").innerHTML = intrebareCurenta.variante.B;
        }

        function verificaRaspuns(varianta) {
            var intrebareCurenta = intrebari[indexIntrebare];

            if (varianta === intrebareCurenta.raspunsCorect) {
                puncte++;
                document.getElementById("rezultat").innerHTML = "Corect! Puncte: " + puncte;
            } else {
                document.getElementById("rezultat").innerHTML = "Greșit. Puncte: " + puncte;
            }
            indexIntrebare++;
            if (indexIntrebare < intrebari.length) {
                afiseazaIntrebare();
            } else {
                document.getElementById("intrebare").innerHTML = "Jocul s-a încheiat. Punctaj final: " + puncte;
                document.getElementById("rezultat").style.display = "none";
            }
        }
        afiseazaIntrebare();
